require 'pry'

def two_sum(numbers, target)
  first = 0
  second = 1

  if target != 0
    short = numbers.uniq
  else
    short = numbers
  end
  # binding.pry
  
  if numbers[first] > target || numbers[second] > target && numbers[first] != 0 && numbers[second] != 0
    first += 1
  else
    until first > (short.length - 1)
      quantity = short.length - (first + 1)
      # binding.pry
      quantity.times do
        if short[first] + short[second] == target
          # binding.pry
          if numbers.index(short[first]) == numbers.index(short[second])
            a = numbers.index(short[first])
            numbers.index(short[first])
            b = numbers.index(short[second])
            return [a + 1, b + 1]
          else
            return [numbers.index(short[first]) + 1, numbers.index(short[second])+ 1]
          end
        else
          second += 1
        end
      end
      # binding.pry
      first += 1
      second = first + 1
    end
  end
end

